  margin: 0 auto;
  text-align: center;
`;

function App() {
  return (
    <ContentSection>
      <ContentTitle>hello world</ContentTitle>
      <p>
        Lorem, ipsum dolor sit amet consectetur adipisicing elit. Quibusdam
        perferendis laudantium facere hic praesentium odio tempora debitis sint
        reprehenderit, facilis optio reiciendis sed explicabo voluptatem
        consequuntur quis fugiat animi. Corporis!
